import logo from './logo.svg';
import './App.css';
import { store } from "./actions/store";
import { Provider } from "react-redux";

function App() {
  return (
    <Provider store={store}>
      <div>
        <h1>My React App</h1>
      </div>
    </Provider>
  );
}

export default App;
